":root {
    color-scheme: light;
}
.container {
  padding-left: 20px;
  padding-right: 20px;
}
.container h1,
.container h2,
.container h3 {
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto,
    Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif,
    "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
  font-weight: 600;
  font-size: 14px;
  line-height: 145%;
  -webkit-letter-spacing: 0.008em;
  -moz-letter-spacing: 0.008em;
  -ms-letter-spacing: 0.008em;
  letter-spacing: 0.008em;
  padding-bottom: 8px;
}
.container p {
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto,
    Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif,
    "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
  font-weight: 400;
  font-size: 14px;
  line-height: 145%;
  -webkit-letter-spacing: 0.008em;
  -moz-letter-spacing: 0.008em;
  -ms-letter-spacing: 0.008em;
  letter-spacing: 0.008em;
  padding-bottom: 20px;
}
.container img {
  max-width: 100%;
}
.container figure {
  padding-bottom: 20px;
}
.container figcaption {
  text-align: center;
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto,
    Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif,
    "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
  font-weight: 400;
  font-size: 12px;
  line-height: 146%;
  -webkit-letter-spacing: 0.0125em;
  -moz-letter-spacing: 0.0125em;
  -ms-letter-spacing: 0.0125em;
  letter-spacing: 0.0125em;
}

@media (prefers-color-scheme: light) {
  .container h1,
  .container h2,
  .container h3 {
    color: #46597c;
  }

  .container p {
    color: #132244;
  }

  .container figcaption {
    color: #46597c;
  }
}"
